import {useState} from 'react';
import RenderAuth from "./AuthPage";

function Login(){
    const [authValue, setAuthValue] = useState(1);
    return( 
        <div className="Main">
            <div className="textUserContent">
                <h2>Ingresar</h2>
            </div>
            <div className="userContent">
                <input></input>
            </div>
            <div className="passwordContent">
                <input></input>
            </div>
            <div>
                <RenderAuth value={authValue} />
                <a href="#" onClick={(e) => {
                    e.preventDefault();
                    setAuthValue(authValue === 1 ? 0 : 1);
                }}>
                    {authValue === 1 ? "Crear cuenta" : "Volver al login"}
                </a>
                </div>
            <div className="buttonContent"></div>
        </div>
    );
}
export default Login;
